import React from 'react';

const ProfessionalSkills = () => {
    return (
        <div className='prof-skills'>
           
            <div className='prof-skills-title'>Professional Skills</div>
            <div className='prof-skill-square-left'>
                <p>HTML & CSS</p>
                <div className = 'prof-skill-gradient-1'>1</div>
                <div className = 'prof-skill-gradient-2'>2</div>
                <div className = 'prof-skill-gradient-3'>3</div>
                <div className = 'prof-skill-gradient-4'>4</div>
                <div className = 'prof-skill-gradient-5'>5</div>
            </div>
            
        </div>
    );
};

export default ProfessionalSkills;
